import { FaSuitcase, FaRobot, FaFileAlt } from "react-icons/fa";
import { NavLink } from "react-router-dom";

export default function Sidebar({ active }) {
  return (
    <div className="w-64 h-screen bg-white shadow-lg p-6 space-y-6">
      <h1 className="text-2xl font-bold text-purple-600">Launch<span className="text-black">Hire</span></h1>

      <nav className="space-y-4">
        <NavLink to="/recommended-jobs" className={`flex items-center gap-3 ${active === "recommended-jobs" ? "text-purple-600 font-semibold" : "text-gray-700"}`}>
          <FaSuitcase /> Recommend Jobs
        </NavLink>
        <NavLink to="/ai-interview-practice" className={`flex items-center gap-3 ${active === "interview" ? "text-purple-600 font-semibold" : "text-gray-700"}`}>
          <FaRobot /> AI Interview Practice
        </NavLink>
        <NavLink to="/ai-resume" className={`flex items-center gap-3 ${active === "resume" ? "text-purple-600 font-semibold" : "text-gray-700"}`}>
          <FaFileAlt /> AI Resume
        </NavLink>
      </nav>
    </div>
  );
}
